import News from './News';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      news1: {
        type: 'top-headlines',
        query: 'sources=bbc-news',
      },
      news2: {
        type: 'everything',
        query: 'domains=techcrunch.com&language=en',
      },
      news3: {
        type: 'everything',
        query: 'domains=wsj.com',
      },
    };
  }
  render() {
    return (
      <div className='container-fluid'>
        <div className='navbar-fixed'>
          <nav></nav>
        </div>
      </div>
    );
  }
}

export default App;
